import React from "react";

function MiddleContent() {
  return (
    <div>
      <div
        style={{
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
        }}
        className="pt-5"
      >
        <div
          style={{
            width: "50%",
          }}
        >
          <h1 className="display-1 text-white font-weight-bold">
            Build your own ecommerce
          </h1>
        </div>
        <div
          style={{
            marginTop: "-25px",
          }}
        >
          <h1 className="display-2 text-white font-weight-bold">
            website in 3 easy steps
          </h1>
        </div>
        <div>
          <p className="text-white h2">
            Shopify is trusted by over 1,700,000 businesses worldwide
          </p>
        </div>
      </div>
      <div
        className=" mt-5 "
        style={{
          width: "95vw",
          display: "flex",
          justifyContent: "center",
        }}
      >
        <input
          placeholder="Enter your email address"
          style={{
            width: "24vw",
            padding: 14,
            borderRadius: 3,
            border: "none",
          }}
        />
        <button
          style={{
            backgroundColor: "#212326",
            color: "white",
          }}
          className="btn  ml-3 p-4"
        >
          Start free trial
        </button>
      </div>
      <div
        style={{
          textAlign: "center",
        }}
      >
        <h6 className="text-white">
          By entering your email, you agree to receive marketing emails from
          Shopify.
        </h6>
      </div>
    </div>
  );
}

export default MiddleContent;
